export const getIconNameByFileType = (type: string): string => {
  switch (type) {
    case "image/jpeg":
    case "image/png":
      return "file image";
    case "application/pdf":
      return "file pdf";
    case "application/vnd.openxmlformats-officedocument.wordprocessingml.document":
      return "file word";
    default:
      return "file";
  }
};
